import React from 'react'
import logo from './'
const Navbar = () => {
  return (
    <div>
        <nav className='bg-bgDark py-4'>
            <img src={logo}></img>
            <h1 className='text-white text-3xl font-bold'>InfoCon</h1>
        </nav>
    </div>
  )
}

export default Navbar
